import React from 'react'
import ForumCard from '../ForumCard';
import {Hero} from '../Hero'
function Forum() {
  return (
    <>
        <Hero MainTextOut="Forum" MainTextSize="100px" MainTextMarginTop=""/>
        <div className="ContainerForum">
            <ForumCard/>
        </div>
    </>
  );
}

export default Forum;
